import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import NavBar from "./component/nav";
import Footer from "./component/Footer";
import Landing from "./component/home/Landing";

function App() {
  return (
    <div>
      <NavBar />
      <Landing />
      <Footer />
    </div>
  );
}

export default App;
